import React, { useEffect, useState } from "react";
import axios from "axios";

const Test = () => {
  const [hello, setResponse] = useState([]);
  useEffect(() => {
    axios
      .get("api/hello")
      .then((response) => {
        console.log(response);
        setResponse(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      <ul>
        {response.map((data) => (
          <li key={response.id}>{response}</li>
        ))}
      </ul>
    </div>
  );
};

export default Test;
